SET NAMES utf8mb4;

CREATE TABLE `postcode_NL` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `PostcodeNummers` int(11) NOT NULL,
  `PostcodeLetters` varchar(2) NOT NULL,
  `PostcodeVolledig` varchar(6) NOT NULL,
  `Straat` varchar(45) NOT NULL,
  `Plaats` varchar(45) NOT NULL,
  `Gemeente` varchar(45) NOT NULL,
  `Provincie` varchar(45) NOT NULL,
  `Latitude` varchar(45) NOT NULL,
  `Longitude` varchar(45) NOT NULL,
  `XCoordinaat` varchar(45) NOT NULL,
  `YCoordinaat` varchar(45) NOT NULL,
  `CreatieDatum` datetime NOT NULL,
  `HuisnummerRangeStart` int(11) NOT NULL,
  `HuisnummerRangeEind` int(11) NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

